package com.yskj.service;import com.yskj.dao.InsRecordDao;import com.yskj.models.InsRecord;import com.yskj.models.QueryParam;import com.yskj.service.base.AbstractService;import org.springframework.beans.factory.annotation.Autowired;import org.springframework.stereotype.Service;import java.util.List;@Servicepublic class InsRecordService extends AbstractService {	@Autowired    private InsRecordDao insRecordDao;	public InsRecordService() {		super();	}	@Override	public InsRecordDao getDao() {		return this.insRecordDao;	}	public InsRecord initRecordInfoMap(QueryParam queryParam){		return getDao().initRecordInfoMap(queryParam);	}	public List<InsRecord> getInsRecordListMap(QueryParam queryParam){		return getDao().getInsRecordListMap(queryParam);	}	public InsRecord getInsRecordMap(QueryParam queryParam){		return getDao().getInsRecordMap(queryParam);	}	public List<InsRecord> getInsQZRecordListMap(QueryParam queryParam){		return getDao().getInsQZRecordListMap(queryParam);	}}